The case expression is the most common kind of flow control in Gleam code. It allows us to say "if the data has this shape then do that", which we call pattern matching . Here we match on an Int and return a specific string for the values 0, 1, and 2. The final pattern n matches any other value that did not match any of the previous patterns. case some_number { 0 -> "Zero" 1 -> "One" 2 -> "Two" n -> "Some other number" // This matches anything
} Pattern matching on a Bool value is the Gleam alternative to the if else statement found in other languages. case some_bool { True -> "It's true!" False -> "It's not true."
} Gleam's case is an expression, meaning it returns a value and can be used anywhere we would use a value. For example, we can name the value of a case expression with a let binding. let description = case True { True -> "It's true!" False -> "It's not true." } description // => "It's true!"

