A case expression can be used to destructure values that contain other values, such as tuples and lists. case xs { [] -> "This list is empty" [a] -> "This list has 1 element" [a, b] -> "This list has 2 elements" _other -> "This list has more than 2 elements"
} It's not just the top level data structure that can be pattern matched, contained values can also be matched. This gives case the ability to concisely express flow control that might be verbose without pattern matching. case xs { [[]] -> "The only element is an empty list" [[], ..] -> "The 1st element is an empty list" [[4], ..] -> "The 1st element is a list of the number 4" other -> "Something else"
} Pattern matching also works in let bindings, though patterns that do not match all instances of that type may result in a runtime error. let [a] = [1] // a is 1
let [b] = [1, 2] // Runtime error! The pattern has 1 element but the value has 2

