When functions take several arguments it can be difficult for the user to remember what the arguments are, and what order they are expected in. To help with this Gleam supports labelled arguments , where function arguments are given an external label in addition to their internal name. Take this function that replaces sections of a string: pub fn replace(string: String, pattern: String, replacement: String) { // ...
} It can be given labels like so. pub fn replace( in string: String, each pattern: String, with replacement: String,
) { // The variables `string`, `pattern`, and `replacement` are in scope here
} These labels can then be used when calling the function. replace(in: "A,B,C", each: ",", with: " ") // Labelled arguments can be given in any order
replace(each: ",", with: " ", in: "A,B,C") // Arguments can still be given in a positional fashion
replace("A,B,C", ",", " ") The use of argument labels can allow a function to be called in an expressive, sentence-like manner, while still providing a function body that is readable and clear in intent.

