There is a shorthand syntax for creating anonymous functions that take one argument and call another function. The _ is used to indicate where the argument should be passed. pub fn add(x, y) { x + y
} pub fn run() { let add_one = add(1, _) add_one(2)
} The function capture syntax is often used with the pipe operator to create a series of transformations on some data. pub fn add(x: Int , y: Int ) -> Int { x + y
} pub fn run() { // This is the same as add(add(add(1, 3), 6), 9) 1 |> add(_, 3) |> add(_, 6) |> add(_, 9)
} In fact, this usage is so common that there is a special shorthand for it. pub fn run() { // This is the same as the example above 1 |> add(3) |> add(6) |> add(9)
} The pipe operator will first check to see if the left hand value could be used as the first argument to the call, e.g. a |> b(1, 2) would become b(a, 1, 2). If not it falls back to calling the result of the right hand side as a function , e.g. b(1, 2)(a).

