Custom types in Gleam can be defined with multiple constructors, making them a way of modeling data that can be one of a few different variants. We've already seen a custom type with multiple constructors in the Language Tour - Bool . Gleam's built-in Bool type is defined like this: // A Bool is a value that is either `True` or `False`
pub type Bool { True False
} It's a simple custom type with constructors that takes no arguments at all! Use it to answer yes/no questions and to indicate whether something is True or False. The records created by different constructors for a custom type can contain different values. For example a User custom type could have a LoggedIn constructor that creates records with a name, and a Guest constructor which creates records without any contained values. type User { LoggedIn(name: String) // A logged in user with a name Guest // A guest user with no details
} let sara = LoggedIn(name: "Sara")
let rick = LoggedIn(name: "Rick")
let visitor = Guest

