let Points(p) = score p // => 50 During destructuring you may also use discards (_) or spreads (..). pub type Cat { Cat(name: String, cuteness: Int, age: Int)
} let cat = Cat(name: "Felix", cuteness: 9001, age: 5) You will need to specify all args for a pattern match, or alternatively use the spread operator. // All fields present
